import React from 'react';
import { Container, Typography } from '@mui/material';
import NotesList from './components/NotesList';

function App() {
  return (
    <Container maxWidth="lg">
      <Typography variant="h3" sx={{ marginTop: 4, textAlign: 'center' }}>
        Notes App
      </Typography>
      <NotesList />
    </Container>
  );
}

export default App;
